import styled from "@emotion/styled";

export const Heading = styled.h1`
    color: #eeeeee;
    margin: 0;
    padding: 0;
    font-size: 2rem;
    font-weight: 500;
    text-shadow: 0px 5px 10px rgba(0, 0, 0, 0.1);
    text-align: center;
`;

export const Subheading = styled.h2`
    color: #eeeeee;
    margin: 0;
    padding: 0;
    font-size: 1.75rem;
    font-weight: 400;
    text-shadow: 0px 5px 10px rgba(0, 0, 0, 0.25);
    text-align: center;
`;

export const StyledHeader = styled.header`
    margin: 24px 0;
    flex: 5 0;
    display: flex;
    flex-flow: column nowrap;
    justify-content: center;
    align-items: center;
`;

export const SmallHead = styled.h3`
    margin: 12px 0;
    padding: 0;
    font-size: 1.25rem;
    font-weight: 500;
    line-height: 1.5;
    text-align: center;
`;
